import React from 'react'
import {Col,Button} from 'react-bootstrap'

const Cell = (props) => {

    return <Col>
        {props.selected && props.selected.selected ? props.selected.player : <Button onClick={props.selectCell(1)} >Click</Button>}
    </Col>
}

export default Cell;
